    public abstract class BaseAssetDefinition : AssetDefinition
    {
        protected abstract ImageSource ImageIcon { get; }
        protected abstract SvgImageData SvgIcon { get; }

        public override ImageSource GetIcon(AssetEntry entry, double width = double.PositiveInfinity, double height = double.PositiveInfinity)
        {
            if (double.IsInfinity(width) || double.IsInfinity(height))
            {
                return ImageIcon;
            }
            else
            {
                return new AssetEntryDisplayCard(entry as EbxAssetEntry, SvgIcon).GetImageSource(width, height);
            }
        }
    }
}
